(175684, 'A6168D85-9261-4923-A84D-1CEB33598181', '10pm and I just showered and in Nathan''s bed. Not at the new place yet...still need to set a bunch of stuff up and i don''t want to bring the boys until it is in a state they will like. Tomorrow will get things in order. Felt comforting to have you with me during the day and I got to think about how much you will enjoy this cool little treehouse. . It is better that I am here for a few days to get settled.  my psyche  can absorb the transition. It feels really weird, but exciting.  I thought while driving about how every time I see your face I get this jolt of dopamine. Just instant happy breathlessness. Should be that way. ', '460186266000000000', '460187668000000000', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'None', 'David', '2015-08-01T22:31:06'),
(175515, 'CCA6A82A-FF06-4385-ACE5-7A32D8911D6B', 'I read some of this to Rachel this morning and have been telling her how wonderful I think you are. Waking up to these notes warms my heart in every way. Thanks for being so affectionate, loving, and warm. You take my breath away too. I feel so lucky to be connected to you.', '460209963000000000', '460217095000000000', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'None', 'nitzan.pelman@gmail.com', '2015-08-02T05:06:03'),
(175615, 'A13531AF-4223-4A5D-8629-69B6E4AB8A85', 'The three hours between when I wake up and when you wake up are the hours I miss you so much. ', '460211057000000000', '460217095000000000', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'None', 'nitzan.pelman@gmail.com', '2015-08-02T05:24:17'),
(175683, '87BBD432-DC05-4090-B8B0-0FD262DF3601', 'When you wake up, call me. I want to see your pretty face ', '460211073000000000', '460217095000000000', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'None', 'nitzan.pelman@gmail.com', '2015-08-02T05:24:33'),
(175618, 'A6798F2C-465B-4649-BF1A-43B93A4CC460', 'I''m up. Kinda. Had a restless/not great sleep. Woke up around 3.  just angry about having to support everything here and dealing with someone who is just actively harming things on every front.  Just pushing through and I don''t take the good things for granted. But, sleeping next to this little dude and I know what is happening is bad for him, and there are things that are beyond my control to fix or prevent.  Think the ultra rational part of me can''t deal with being sabotaged like this. It requires a totally different set of tools....non-reaction, non-resistance, not feeling like I have to dive in and fix.  Well...opportunities to grow and learn are everywhere, right???', '460218207000000000', '460218281000000000', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'None', 'David', '2015-08-02T07:23:27'),
